from itertools import combinations

class Solution:
    def buddyStrings(self, A: str, B: str) -> bool:
        if len(A) != len(B):
            return False
        if len(A) < 2:
            return False
        
        for i, j in combinations(range(len(A)), 2):
            newA = A[:i] + A[j] + A[i+1:j] + A[i] + A[j+1:]
            if newA == B:
                return True
        
        return False

